"use strict";
module.exports = /*#__PURE__*/JSON.parse('{"projects":[{"title":"GroofStreet  NFT Collection & P2E Game","description":"Demons are your friends! Groof Street is an NFT collection and P2E game developed by Max Acrone Studio. A strategic MMORPG set in the DevilTroid metaverse where players develop districts, recruit gangs, and battle for territory.","category":"Web3","tags":["NFT","P2E Game","Metaverse","Strategic MMORPG","DevilTroid","Blockchain Gaming"],"image":"/images/projects/Project1/banner1.jpg","slug":"project1","content":"Groof Street represents the embodiment of our vision to change the world through NFT art and gaming. Developed by Max Acrone Studio in 2022, this project combines a unique NFT collection with an innovative P2E (Play-to-Earn) game set in the DevilTroid metaverse. Players can develop their districts, recruit demon gangs, and engage in strategic battles for territory control. The game features multiple factions, farming systems, staking mechanics, and various battle modes including PVP and PVE. Each victory rewards players with $DTC tokens and district upgrades. The project also includes a DevilPass system for additional rewards and future features like Mutations, Area Defense, and DAO governance. Groof Street is more than just NFTs - it\'s a complete gaming ecosystem where demons are your friends and strategic thinking leads to victory. | Discord: https://discord.gg/T4g6rwET | Twitter: https://x.com/GroofStreet | Website: https://groofstreet.com","featured":true,"id":"1","techStack":["Solidity","Unity","Web3","Ethereum","IPFS","Improbable M2","React","Node.js"],"team":["Max Acrone Studio","Game Developers","NFT Artists","Blockchain Specialists","Marketing Team"],"impact":["10,000+ NFT holders","Active P2E gaming community","Featured in major gaming conferences","Partnership with Improbable M2 network"],"contribution":"I led the overall project development, designed the strategic MMORPG mechanics, created the DevilTroid metaverse concept, and established partnerships with key gaming and blockchain platforms.","client":"Max Acrone Studio","services":["NFT Collection Design","P2E Game Development","Metaverse Creation","Blockchain Integration"],"goals":"Create a revolutionary NFT collection combined with a strategic MMORPG that allows players to develop districts, recruit demon gangs, and battle for territory while earning rewards through play-to-earn mechanics.","screens":["/images/projects/Project1/banner2.jpg","/images/projects/Project1/gallery1.jpg"],"previewUrl":"https://groofstreet.com","twitterUrl":"https://x.com/GroofStreet","discordUrl":"https://discord.gg/T4g6rwET","date":"2022-01-01"},{"title":"SoundSphere  NFT Music Experience Platform","description":"NFT music platform where tracks come alive with motion visuals. Built custom Python backend that perfectly matched beats with visuals for interactive music experiences.","category":"Web3","tags":["NFT","Music","Motion Graphics","Python","FastAPI","DeFi"],"image":"/images/projects/project2.jpg.svg","slug":"project2","content":"Music is one of the most emotional forms of art, yet tokenizing it without losing its essence was a challenge. We worked with an indie record label to build SoundSphere, an NFT music platform where tracks come alive with motion visuals. The hardest part was syncing visual effects in real time with blockchain-protected audio streams. After several failed attempts, we built a custom Python backend that perfectly matched beats with visuals. Fans could not only own music but also interact with itunlocking hidden layers of animation with each playback. The project was awarded recognition at a regional Web3 Hackathon for \\"Best User Experience.\\"","featured":true,"id":"2","techStack":["Python (FastAPI)","Solidity","Web3.py","Next.js","D3.js","PostgreSQL"],"team":["2 Backend Developers","1 Frontend Dev","1 Data Scientist","1 Motion Designer"],"impact":["Helped secure $500k in seed funding","Increased user retention by 35%","Named one of the Top 10 Baltic Fintech Startups 2023"],"contribution":"I designed the Python backend with FastAPI, connected to major DeFi protocols (Uniswap, Aave), and animated the dashboard experience with smooth data-driven motion graphics."},{"id":"3","title":"GreenChain  Eco NFT Initiative","description":"Blockchain initiative proving NFTs can inspire positive change. Created NFTs that funded real tree-planting campaigns with IoT sensors and live dashboard.","category":"Web3","tags":["NFT","Sustainability","IoT","Blockchain","Environmental","Generative Art"],"image":"/images/projects/project3.jpg.svg","slug":"project3","content":"Not all NFTs are about speculation. With GreenChain, we set out to prove blockchain can inspire positive change. Partnering with a mid-sized environmental NGO, we created NFTs that funded real tree-planting campaigns. The challenge was transparencyusers wanted proof their purchase had real-world impact. To solve this, we integrated IoT sensors and a live dashboard powered by blockchain, showing growth progress of sponsored trees. Motion design elements helped make the data not only clear but beautiful. The project gained local press coverage and won the NGO an eco-tech grant, while showing that Web3 can indeed go green.","featured":true,"date":"2024-01-20","techStack":["Python","Processing","Solidity","Blender","After Effects","IPFS"],"team":["1 Blockchain Dev","2 Digital Artists","1 Marketing Specialist"],"impact":["Sold out in just 3 hours","Over $320k in sales within the first week","Highlighted on Rarible\'s Trending Projects"],"contribution":"I built the generative art algorithm in Python, deployed the ERC-721 smart contracts, and crafted animated promo content to boost visibility."},{"id":"4","title":"FrameFlux  Motion Design SaaS","description":"Cloud-based motion rendering pipeline that cut production time by 70%. Introduced blockchain-based licensing for animations ensuring artists get paid fairly.","category":"SaaS","tags":["SaaS","Motion Graphics","Cloud Rendering","Blockchain","Animation","Smart Contracts"],"image":"/images/projects/project4.jpg.svg","slug":"project4","content":"FrameFlux was born from a frustration I personally facedhow to deliver motion graphics faster without losing quality. Initially, our prototype SaaS tool was lagging, and rendering times scared potential testers away. Through countless iterations, we built a cloud-based motion rendering pipeline that cut production time by 70%. Collaborating with a small animation studio gave us crucial feedback, and soon the platform became their go-to solution. The tool not only improved speed but introduced blockchain-based licensing for animations, ensuring artists got paid fairly. This project taught us how deeply motion design and smart contracts can complement each other.","featured":false,"date":"2023-12-05","techStack":["Solidity","React","Tailwind","Python (Flask)","IPFS","Figma"],"team":["1 Web3 Dev","1 UI/UX Designer","1 Product Owner","1 QA Engineer"],"impact":["Over 5000 NFT tracks sold in 6 months","Artists boosted revenue by 18%","Awarded Best MusicTech Startup 2023 at Warsaw Digital Fest"],"contribution":"I developed the smart contracts for royalty splits, designed the platform\'s UX, and created sleek animations for artist campaigns."},{"id":"5","title":"EduVerse  Blockchain Learning Hub","description":"Gamified education platform with NFT-based certificates and animated learning quests. Increased completion rates through motion design storytelling.","category":"Education","tags":["Education","Blockchain","NFT","Gamification","Motion Graphics","Learning"],"image":"/images/projects/project5.jpg.svg","slug":"project5","content":"Education is ripe for innovation, but bridging blockchain and learning isn\'t easy. With EduVerse, created alongside a regional tech academy, we set out to gamify education. The hardest obstacle was user engagementstudents often dropped out after the first week. Our solution was to integrate NFT-based certificates and animated learning quests designed with motion design storytelling. Completion rates skyrocketed, as learners could showcase NFTs as proof of skills on LinkedIn. The academy later reported a 40% increase in retention. EduVerse is still used today, and seeing how students proudly \\"wear\\" their certificates made every technical challenge worth it.","featured":false,"date":"2023-11-15","techStack":["After Effects","Cinema4D","React","GSAP","Figma"],"team":["1 Motion Designer","1 Scriptwriter","1 Voice Actor","1 Frontend Dev"],"impact":["1M+ YouTube views","Adopted by European Blockchain School as official learning material","Winner of Best EdTech Content 2023 (Czech Startup Awards)"],"contribution":"I directed the creative process, produced the motion graphics in After Effects & Cinema4D, and helped integrate the videos into an interactive educational platform."},{"id":"6","title":"CryptoGallery  Virtual NFT Art Museum","description":"Virtual NFT art museum with holographic paintings and sculptures, futuristic VR environment with immersive lighting, digital art frames glowing subtly, visitors walking in a sleek 3D hall.","category":"VR/AR","tags":["VR","NFT","Art","Metaverse","3D","Holographic"],"image":"/images/projects/project6.jpg.svg","slug":"project6","content":"CryptoGallery represents the future of digital art curation in the metaverse. We created a virtual NFT art museum where visitors can explore holographic paintings and sculptures in an immersive VR environment. The challenge was designing a space that felt both futuristic and welcoming, with lighting that enhanced each artwork without overwhelming the viewer. We integrated real-time NFT data streams and created interactive elements that allowed visitors to learn about each piece\'s blockchain provenance. The gallery features polished reflective floors and sleek 3D architecture that makes digital art feel tangible and valuable.","featured":false,"date":"2023-10-01","techStack":["Unity","WebXR","Three.js","Solidity","IPFS","React","WebGL"],"team":["1 VR Developer","1 3D Artist","1 UI/UX Designer","1 Blockchain Specialist"],"impact":["10,000+ virtual visitors in first month","Featured at Venice Biennale Digital Pavilion","Partnership with major NFT art collections"],"contribution":"I designed the VR environment architecture, created immersive lighting systems, and integrated blockchain data visualization for artwork provenance."}],"categories":["Web3","SaaS","Education","VR/AR"]}');

